import Grid2 from "@mui/material/Grid2";
import Typography from "@mui/material/Typography";
import styles from "./scss/IntroTextBox.module.scss";
import { useNavigate } from "react-router-dom";
import { Button } from "@mui/material";
// import { useWindowWidth } from '../../../hooks/useWindowWidth';
import ScreenSize from "../../../../types/enums/ScreenSize";
const IntroTextBox = () => {
  const navigate = useNavigate();
  // const windowWidth = useWindowWidth();
  // const isMobile = windowWidth < ScreenSize.sm;
  return (
    <Grid2
      id="introTextBox"
      container
      className={styles.introTextBoxContainer}
      size={{ xs: 10 }}
    >
      <Grid2 id="introTextBoxHeader">
        <Typography className={styles.header}>Anti-diet</Typography>
        <Typography className={styles.header}>{"meal delivery for"}</Typography>
        <Typography className={styles.header}>
          {"eating disorder recovery"}
        </Typography>
      </Grid2>
      <Grid2>
        <Typography className={styles.subheader}>
          Chera is designed to make recovery simpler, kinder, and more
          accessible
        </Typography>
      </Grid2>
      <Grid2 container className={styles.signupButtonContainer}>
        <Button
          id="getStartedButton"
          variant={"contained"}
          onClick={() => navigate("/dietitian-sign-up")}
          className={styles.button}
        >
          Get started
        </Button>
      </Grid2>
    </Grid2>
  );
};
export default IntroTextBox;
